import { Card, CardContent } from '@material-ui/core'
import React from 'react'

import imag4 from '../resurces/imag4.png'

export function ListCards({ card }) {
  return (
    <>
      <Card
        sx={{ width: '980px', display: 'flex', m: 5, flexDirection: 'column' }}
      >
        {card.map((e, i) => (
          <CardContent key={i} sx={{ margin: 5 }}>
            <img
              src={imag4}
              alt=''
              style={{ width: '100px', height: '100px' }}
            />
            <p>{e.title}</p>
          </CardContent>
        ))}
      </Card>
    </>
  )
}
